import React, { Component } from "react";
import axios from "axios";

export default class ExerciseList extends Component {
  constructor(props) {
    super(props);

  }
  componentDidMount(){
    axios.get('localhost:5000/exercises/')
    .then((el)=>{
      console.log(el.data);
    });
  }

  render() {
    return <div>Exercises List</div>;
  }
}
